import React from 'react';

const MyCard = () =>{

    return (
      <div className={'myCard'}>
        <ul className={'card'}>
          <li>LinkedIn <a href={'linkedIn.com'}> <i className="fab fa-linkedin"></i> </a></li>
          <li>FaceBook</li>
          <li>GitHub</li>
          <li> </li>
          <li>Resume</li>
        </ul>
      </div>
    );
};

export default MyCard;
